function hasClass(a, b) {
    return new RegExp(" " + b + " ").test(" " + a.className + " ")
}

function addClass(a, b) {
    hasClass(a, b) || (a.className += " " + b)
}

function removeClass(a, b) {
    var c = " " + a.className.replace(/[\t\r\n]/g, " ") + " ";
    if (hasClass(a, b)) {
        for (; c.indexOf(" " + b + " ") >= 0;) c = c.replace(" " + b + " ", " ");
        a.className = c.replace(/^\s+|\s+$/g, "")
    }
}

function toggleClass(a, b) {
    var c = " " + a.className.replace(/[\t\r\n]/g, " ") + " ";
    if (hasClass(a, b)) {
        for (; c.indexOf(" " + b + " ") >= 0;) c = c.replace(" " + b + " ", " ");
        a.className = c.replace(/^\s+|\s+$/g, "")
    } else a.className += " " + b
}

function parallax(a) {
    xPos = a.pageX / mouseSensitivity, yPos = a.pageY / mouseSensitivity, moveLayers()
}

function bgicos() {
    TweenLite.to(".bgicons", layerOneSpeed, {
        x: xPos,
        y: -yPos,
        ease: Power4.easeOut
    })
}

function moveLayers() {
    TweenLite.to(".svggraphic", layerOneSpeed, {
        x: xPos,
        y: -yPos,
        ease: Power4.easeOut
    }), TweenLite.to(".blobs", layerTwoSpeed, {
        x: -xPos,
        y: yPos,
        ease: Power4.easeOut
    })
}
